import React from "react";
import { Nav, Navbar } from "rsuite";

const BottomNav = () => {
  const navBarStyles ={
      display: "flex",
      position: "absolute",
      bottom: 0,
      width: "100%"
  }
  return (
    <div>
      <Navbar className={"unstyledList"} style={navBarStyles}>
        <Nav.Item>
          <button className="primaryButton" style={{ width: "6rem" }}>
            + Project
          </button>
        </Nav.Item>
        <Nav.Item>
          <button className="primaryButton" style={{ width: "8rem" }}>
            + Code Snippet
          </button>
        </Nav.Item>
        <Nav.Item>
          <button 
            className="primaryButton" 
            sytle={{ 
                width: "6rem",
                alignSelf:"flex-end"}}>
            Settings
          </button>
        </Nav.Item>
      </Navbar>
    </div>
  );
};

export default BottomNav;
